progress {
  -webkit-appearance: none;
  max-height: 8px;
  box-sizing: border-box;
  border: 1px solid #1c1c1c;
  position: relative;
  overflow: hidden;
  border-radius: 8px;
  background-clip: padding-box;
}
progress::-webkit-progress-bar {
  background: #fff;
}
progress::-webkit-progress-value {
  background-color: #ce5cd6;
  box-shadow: inset 0 0 2px #ce5cd6;
}
progress:not([value])::-webkit-progress-bar {
  background: #e7adeb;
}
progress:not([value])::after {
  content: '';
  display: block;
  position: absolute;
  left: 25%;
  top: 0;
  width: 50%;
  height: 100%;
  background: #ce5cd6;
  z-index: 1;
  background: radial-gradient(circle, #ce5cd6, #e7adeb);
  transform: translate(0);
  -webkit-animation: animate 3s alternate ease-in-out infinite;
}
